import { useState } from "react";
import camera from "../../public/camera.svg"
//set initialState
const initialState = {
    name : '',
    email:'',
    password: '',
    repassword: '',
    err: '',
    success : '',
}

const Registerpage = () => {

    //hook
    const [registeruser,setRegisterUser] = useState(initialState)

    const {name,email,password} = registeruser;

    return (

        <div className="loginpage">
            <div className="form2">
                
                <h2 style={{color:'rgb(252, 245, 245)', marginTop: 10, }}>Let's to be one of us</h2>

                <div className="avatar">
                    <img src={camera} className="camera"/>
                </div>
                
                <form className ="form-group">
                <input type = "text" placeholder = " Your user's name" className = "inputfiled" id="name" name="name" value={name} ></input>    
                <input type = "email" placeholder = "Type your Email" className = "inputfiled" id="email" name="email" value={email} ></input>
                <input type = "password" placeholder = "Password" className = "inputfiled" id="password" name="password" value={password}></input>


                </form>


            </div>
        </div>
    )

}

export default Registerpage;
